function dobj:addmonths(m, d)
		return self:addyears(nil, m, d)
	end

local function dobj_adddayfrc(self,n,pt,pd)
		n = tonumber(n)
		if n then
			local x = floor(n/pd);
			self.daynum = self.daynum + x;
			self.dayfrc = self.dayfrc + (n-x*pd)*pt;
			return self:normalize()
		else
			return date_error_arg()
		end
	end

